import styled from "@emotion/styled";
import PokeMarkChip from "../components/PokeMarkChip";
import { useEffect } from "react";
import { useParams } from "react-router-dom";
import { PokeImageSkeleton } from "../components/PokeImageSkeleton";
import { useSelector } from "react-redux";
import { RootState, useAppDispatch } from "../Store";
import { fetchPokemonDetail } from "../Store/pokemondetailSlice";

const PokemonDetail = () => {
  const { name } = useParams();
  const imageType = useSelector((state: RootState) => state.imageType.type);
  const { pokemonDetails } = useSelector(
    (state: RootState) => state.pokemonDetail
  );
  const pokemon = name ? pokemonDetails[name] : null;
  const dispatch = useAppDispatch();

  useEffect(() => {
    if (!name) {
      return;
    }
    dispatch(fetchPokemonDetail(name));
  }, [dispatch, name]);

  if (!name || !pokemon) {
    return (
      <Container>
        <ImageContainer>
          <PokeImageSkeleton />
        </ImageContainer>
        <Divider />
        <Footer>
          <PokeMarkChip />
        </Footer>
      </Container>
    );
  }

  return (
    <Container>
      <ImageContainer>
        <Image src={pokemon.images[imageType]} alt={pokemon.koreanName} />
      </ImageContainer>
      <Divider />
      <Body>
        <h2>기본정보</h2>
        <Table>
          <TableRow>
            <TableHeader>번호</TableHeader>
            <td>{pokemon.id}</td>
          </TableRow>
          <TableRow>
            <TableHeader>이름</TableHeader>
            <td>{`${pokemon.koreanName} (${pokemon.name})`}</td>
          </TableRow>
          <TableRow>
            <TableHeader>타입</TableHeader>
            <td>{pokemon.types.toString()}</td>
          </TableRow>
          <TableRow>
            <TableHeader>키</TableHeader>
            <td>{pokemon.height} m</td>
          </TableRow>
          <TableRow>
            <TableHeader>몸무게</TableHeader>
            <td>{pokemon.weight} kg</td>
          </TableRow>
        </Table>
        <h2>능력치</h2>
        <Table>
          <tbody>
            {pokemon.baseStats.map((stat) => {
              return (
                <TableRow key={stat.name}>
                  <TableHeader>{stat.name}</TableHeader>
                  <td>{stat.value}</td>
                </TableRow>
              );
            })}
          </tbody>
        </Table>
      </Body>
      <Footer>
        <PokeMarkChip />
      </Footer>
    </Container>
  );
};

const Container = styled.section`
  border: 1px solid #c0c0c0;
  margin: 16px 32px;
  border-radius: 16px;
  box-shadow: 1px 1px 3px 1px #c0c0c0;
`;

const ImageContainer = styled.section`
  display: flex;
  flex: 1 1 auto;
  justify-content: center;
  align-items: center;
  margin: 8px 0;
  min-height: 350px;
`;

const Image = styled.img`
  width: 350px;
  height: 350px;
`;

const Divider = styled.hr`
  margin: 32px;
  border-style: none;
  border-top: 1px dashed #d3d3d3;
`;

const Body = styled.section`
  margin: 0 32px;
`;

const Table = styled.table`
  width: 100%;
  border-collapse: collapse;
  border-spacing: 0;
  margin: 0 auto 12px;

  td,
  td {
    padding: 6px 12px;
  }
`;

const TableRow = styled.tr`
  border-width: 1px 0;
  border-style: solid;
  border-color: #c0c0c0;
`;

const TableHeader = styled.th`
  width: 1px;
  white-space: nowrap;
  text-align: left;
  font-weight: normal;
  font-size: 14px;
  color: #c0c0c0;
`;

const Footer = styled.section`
  display: flex;
  flex-direction: row;
  margin: 32px 16px;
`;

export default PokemonDetail;
